import React, { Component } from 'react';

class App extends Component {
  constructor() {
    super();
    this.state = {
      isLogged: false,
    };
  }

  render() {
    let disp = this.state.isLogged ? 'Logged in' : 'Logged out';

    return <div>{disp}</div>;
  }
}

export default App;
